import React, { useState } from 'react';

interface Score {
    playerName: string;
    score: string;
    avatar: string;
    isCorrect?: boolean;
}

function PlayerScore() {
    // Mock data for demonstration
    const [scoreList] = useState<Score[]>([
        { playerName: "Alice", score: "150", avatar: "https://api.dicebear.com/7.x/avataaars/svg?seed=Alice" },
        { playerName: "Bob", score: "120", avatar: "https://api.dicebear.com/7.x/avataaars/svg?seed=Bob" },
        { playerName: "Charlie", score: "100", avatar: "https://api.dicebear.com/7.x/avataaars/svg?seed=Charlie" },
        { playerName: "Diana", score: "80", avatar: "https://api.dicebear.com/7.x/avataaars/svg?seed=Diana" },
    ]);

    const getRankIcon = (index: number) => {
        switch (index) {
            case 0:
                return (
                    <div className="w-6 h-6 bg-yellow-500 rounded-full flex items-center justify-center text-white text-xs font-bold shadow-lg">
                        üëë
                    </div>
                );
            case 1:
                return (
                    <div className="w-6 h-6 bg-gray-400 rounded-full flex items-center justify-center text-white text-xs font-bold shadow-lg">
                        ü•à
                    </div>
                );
            case 2:
                return (
                    <div className="w-6 h-6 bg-amber-600 rounded-full flex items-center justify-center text-white text-xs font-bold shadow-lg">
                        ü•â
                    </div>
                );
            default:
                return (
                    <div className="w-6 h-6 bg-slate-300 rounded-full flex items-center justify-center text-slate-700 text-xs font-bold">
                        {index + 1}
                    </div>
                );
        }
    };

    const getRankBorder = (index: number) => {
        switch (index) {
            case 0:
                return "border-l-4 border-yellow-500 bg-gradient-to-r from-yellow-50 to-white shadow-lg";
            case 1:
                return "border-l-4 border-gray-400 bg-gradient-to-r from-gray-50 to-white shadow-md";
            case 2:
                return "border-l-4 border-amber-600 bg-gradient-to-r from-amber-50 to-white shadow-md";
            default:
                return "border-l-4 border-slate-200 bg-white hover:bg-slate-50 shadow-sm";
        }
    };

    return (
        <div className="bg-white rounded-xl shadow-lg overflow-hidden border border-slate-200 w-80">
            {/* Header */}
            <div className="bg-gradient-to-r from-blue-600 to-purple-600 px-4 py-3">
                <h3 className="text-white font-bold text-lg flex items-center gap-2">
                    <div className="w-5 h-5 bg-yellow-400 rounded-full flex items-center justify-center">
                        üëë
                    </div>
                    Leaderboard
                </h3>
            </div>

            {/* Scores Container */}
            <div 
                className="relative overflow-hidden"
                style={{ height: `${Math.max(scoreList.length * 70, 200)}px` }}
            >
                {scoreList.length === 0 ? (
                    <div className="flex items-center justify-center h-full text-slate-500">
                        <div className="text-center">
                            <div className="w-8 h-8 mx-auto mb-2 text-slate-300 text-2xl">üèÜ</div>
                            <p className="text-sm">No scores yet</p>
                        </div>
                    </div>
                ) : (
                    scoreList.map((player: Score, index: number) => (
                        <div
                            key={player.playerName}
                            className={`absolute w-full px-4 py-3 flex items-center gap-3 transition-all duration-500 ease-in-out transform hover:scale-[1.02] ${getRankBorder(index)}`}
                            style={{
                                top: `${index * 70}px`,
                            }}
                        >
                            {/* Rank Icon */}
                            <div className="flex-shrink-0">
                                {getRankIcon(index)}
                            </div>

                            {/* Player Avatar */}
                            <div className="relative flex-shrink-0">
                                <img
                                    src={player.avatar}
                                    alt={player.playerName}
                                    className="w-10 h-10 rounded-full border-2 border-white shadow-md object-cover"
                                />
                                {index === 0 && (
                                    <div className="absolute -top-1 -right-1 w-4 h-4 bg-yellow-500 rounded-full border border-white flex items-center justify-center">
                                        <div className="w-2 h-2 bg-white rounded-full"></div>
                                    </div>
                                )}
                            </div>

                            {/* Player Info */}
                            <div className="flex-1 min-w-0">
                                <p className="font-semibold text-slate-800 truncate text-sm">
                                    {player.playerName}
                                </p>
                                <div className="mt-1">
                                    <div className="bg-gradient-to-r from-slate-100 to-slate-50 rounded-lg px-3 py-1 border border-slate-200">
                                        <span className="text-xs font-medium text-slate-600">Score: </span>
                                        <span className="text-sm font-bold text-slate-800">{player.score}</span>
                                    </div>
                                </div>
                            </div>

                            {/* Position Indicator */}
                            <div className="flex-shrink-0 text-right">
                                <div className="text-xs text-slate-500 font-medium">
                                    #{index + 1}
                                </div>
                            </div>
                        </div>
                    ))
                )}
            </div>
        </div>
    );
}

export default PlayerScore;
